import React from 'react'
import {  Route, Switch } from 'react-router-dom';
import Notes from './public/notes';

 const rightContainer = () => {
    return (

       <Switch>

       <Route exact path="/" component={Notes}/>

       <Route exact path="/reminders" component={Reminders}/>
       <Route exact path="/labels" component={Labels}/>
       <Route exact path="/archive" component={ModifyLabels}/>
       <Route exact path="/modifyLables" component={ModifyLabels}/>
       <Route exact path="/delete" component={Notes}/>


       </Switch>
    )
}
export default rightContainer;
